version_msg("\"\n");

}

#endif 

version_msg("\nRun :checkhealth for more info");

}

{

if (BUFEMPTY()

&& (curbuf->b_fname == NULL)

&& (firstwin->w_next == NULL)

&& (vim_strchr(p_shm, SHM_INTRO) == NULL)) {

intro_message(FALSE);

}

}

{

int i;

long row;

long blanklines;

int sponsor;

char *p;

static char *(lines[]) = {

N_(NVIM_VERSION_LONG),

"",

N_("Nvim is open source and freely distributable"),

N_("https://neovim.io/#chat"),

"",

N_("type :help nvim<Enter> if you are new! "),

N_("type :checkhealth<Enter> to optimize Nvim"),

N_("type :q<Enter> to exit "),

N_("type :help<Enter> for help "),

"",

N_("Help poor children in Uganda!"),

N_("type :help iccf<Enter> for information "),

};

size_t lines_size = ARRAY_SIZE(lines);

assert(lines_size <= LONG_MAX);

blanklines = Rows - ((long)lines_size - 1l);

if (p_ls > 1) {

blanklines -= Rows - topframe->fr_height;

}

if (blanklines < 0) {

blanklines = 0;

}

sponsor = (int)time(NULL);

sponsor = ((sponsor & 2) == 0) - ((sponsor & 4) == 0);

row = blanklines / 2;

if (((row >= 2) && (Columns >= 50)) || colon) {

for (i = 0; i < (int)ARRAY_SIZE(lines); ++i) {

p = lines[i];

if (sponsor != 0) {

if (strstr(p, "children") != NULL) {

p = sponsor < 0

? N_("Sponsor Vim development!")

: N_("Become a registered Vim user!");

} else if (strstr(p, "iccf") != NULL) {

p = sponsor < 0

? N_("type :help sponsor<Enter> for information ")

: N_("type :help register<Enter> for information ");

} else if (strstr(p, "Orphans") != NULL) {

p = N_("menu Help->Sponsor/Register for information ");

}

}

if (*p != NUL) {

do_intro_line(row, (char_u *)_(p), 0);

}

row++;

}

}

if (colon) {

assert(row <= INT_MAX);

msg_row = (int)row;

}

}

{

long col;

char_u *p;

int l;

int clen;

col = vim_strsize(mesg);

col = (Columns - col) / 2;

if (col < 0) {

col = 0;

}

for (p = mesg; *p != NUL; p += l) {

clen = 0;

for (l = 0; p[l] != NUL

&& (l == 0 || (p[l] != '<' && p[l - 1] != '>')); ++l) {

if (has_mbyte) {

clen += ptr2cells(p + l);

l += (*mb_ptr2len)(p + l) - 1;

} else {

clen += byte2cells(p[l]);

}

}

assert(row <= INT_MAX && col <= INT_MAX);

grid_puts_len(&default_grid, p, l, (int)row, (int)col,

*p == '<' ? HL_ATTR(HLF_8) : attr);

col += clen;

}

}
